import {Link} from 'react-router-dom';
import logo from "./pigeon-logo.png";

const Navbar = () => {
    return (
        <>
        <div className="header">version 1.0</div>
        <nav className="navbar">
            <img src={logo} alt="Web Pigeon Logo"/>
            <h1>Web Pigeon</h1>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/">Find</Link>
                <Link to="/create" >Create</Link>
            </div>
        </nav>
        </>
    );
}
 
export default Navbar;
